import Nav from "./Nav";
import Logo from "../assets/logo.svg";
import "../style/header.css";

function Header() {
	let clickState = false;
	return (
		<>
          <header>
            <img src={Logo} alt="logo" />
            <div className="toggle" onClick={() => {clickState = true}}></div>
            <Nav active={clickState}/>
          </header>
		</>
	);
}

export default Header;
